    useEffect(() => {
        var content = {
            method : "GET",
            headers : {
                "Content-Type": "application/json"
            },
        };
  
        fetch("http://127.0.0.1:3000/getDpfBcmd/"+params.idProformat, content)
        .then((response)=>{
            return response.json();
        })
        .then((json)=>{
            console.log(json);
            setDetails(json)
            // console.log(allProformat);
        })
    }, [])
    
    return(
        <Fragment>
            {/* {details.map( (element,index) =>(
                <div key={index}>
